var $bm_rt;
var freq, decay, t, startVal, endVal, dur;
freq = 2;
decay = 7;
t = sub(time, inPoint);
startVal = [
    0,
    0
];
endVal = [
    780,
    780
];
$bm_rt = dur = 0.1;
if (t < dur) {
    $bm_rt = linear(t, 0, dur, startVal, endVal);
} else {
    amp = div(sub(endVal, startVal), dur);
    w = mul(freq, Math.PI);
    $bm_rt = sum(endVal, mul(amp, div(div(Math.sin(mul(sub(t, dur), w)), Math.exp(mul(decay, sub(t, dur)))), w)));
}
